import React from 'react';
import { Button, Grid, Typography } from '@mui/material';
import { Link } from 'react-router-dom';
import PanToolAltRoundedIcon from '@mui/icons-material/PanToolAltRounded';

const RegisterLoginPage = () => {
  return (
    <Grid container justifyContent="center" alignItems="center" style={{ height: '100vh' }}>
      <Grid item>
        <Typography variant="h4" align="center" gutterBottom color="secondary">
          Welcome to Wholesome!
        </Typography>
        <Typography variant="h6" align="center" gutterBottom color="secondary" style={{ marginBottom: '1rem' }}>
          As a dietitian, would you like to use the application, or as a user?
        </Typography>
        <Grid container justifyContent="center" spacing={2}>
          <Grid item>
            <Button
              color="secondary"
              component={Link}
              to="/registerPageNutritionist"
              variant="contained"
              endIcon={<PanToolAltRoundedIcon />}
            >
              Nutritionist
            </Button>
            <PanToolAltRoundedIcon />
          </Grid>
          <Grid item>
            <Button
              color="secondary"
              component={Link}
              to="/registerPageUser"
              variant="contained"
              endIcon={<PanToolAltRoundedIcon />}
            >
              User
            </Button>
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
};

export default RegisterLoginPage;
